from collections import Counter

class Solution:
    def isSubsequence(self, s: str, t: str):
        if not s and not t or not s and t:
            return True
        if len(s) > len(t):
            return False

        chars = set(s)
        arr2 = []
        for ch in t:
            if ch in chars and (not arr2 or arr2[-1] != ch):
                arr2.append(ch)
        arr1 = []
        for ch in s:
            if not arr1 or arr1[-1] != ch:
                arr1.append(ch)
        freq1 = Counter(s)
        freq2 = Counter(t)
        for i in range(len(arr1)):
            if arr1[i] != arr2[i] or freq1[arr1[i]] > freq2[arr1[i]]:
                return False
        return True

sol = Solution()
print(sol.isSubsequence("leeeeetcode",
                        ""))
